import styled from "styled-components";

const StyledContact = styled.div`
/* ContactMe.css */

.contact-me {
    text-align: center;
    margin-bottom: 40px;
    }

    .Pro {
        color: salmon;
        margin: 1rem;
        font-size: 2.44rem;
        text-align: center;
    }

    .social-links {
        display: flex;
        justify-content: center;
    }

    a {
        display: inline-block;
        margin: 0 6px;
    }

    img {
        width: 10px;
        height: 5px;
    }
`;
export default StyledContact;
